{
  "root": true,
  "env": {
    "browser": true,
    "node": true
  },
  "extends": ["./jslib/shared/eslintrc.json"],
  "rules": {
    "import/order": [
      "error",
      {
        "alphabetize": {
          "order": "asc"
        },
        "newlines-between": "always",
        "pathGroups": [
          {
            "pattern": "jslib-*/**",
            "group": "external",
            "position": "after"
          },
          {
            "pattern": "src/**/*",
            "group": "parent",
            "position": "before"
          }
        ],
        "pathGroupsExcludedImportTypes": ["builtin"]
      }
    ]
  }
}

{
  "printWidth": 100
}

